const App = () => {
    const course = 'Half Stack application development'

    const part1 = 'Fundamentals of React'
    const exercises1 = 10

    const part2 = 'Using props to pass data'
    const exercises2 = 7

    const part3 = 'State of a component'
    const exercises3 = 14

    return (
        <>
            <Header name={ course } />
            <Content data={[
                [part1, exercises1],
                [part2, exercises2],
                [part3, exercises3]
            ]} />
            <Total points={ exercises1 + exercises2 + exercises3 } />
        </>
    )
}

const Header = ({ name }) => { return (
    <h1>{ name }</h1>
)}

const Content = ({ data }) => {
    data.map((name, points) =>
        <Part name={ name } points={ points } />
    )
}

const Part = ({ name, points }) => { return (
    <p>{ name } { points }</p>
)}

const Total = ({ points }) => { return (
    <p>Number of exercises { points }</p>
)}

export default App
